// src/components/Result.js
import React from 'react';
import { Typography } from '@material-ui/core';

const Result = ({ result }) => (
  <div className="result">
    <Typography variant="h6" gutterBottom>
      Result:
    </Typography>
    <Typography>{result}</Typography>
  </div>
);

export default Result;
